import React, { Component } from "react";
import { Container, Navbar } from "react-bootstrap";


class HomePage extends Component {
    render() {
        return(
            <Container>
                <Navbar bg="dark">
                    <Navbar.Brand>LOGO</Navbar.Brand>
                </Navbar>
            </Container>
        );
    }
}

export default HomePage;
